def flrt(exp,x):
    l=max(0,math.floor(x**(1/exp))-3)

    r= math.floor(x**(1/exp))+3
    while l<r:
        mid=(l+r)//2
        if mid**exp<=x:
            l=mid+1
        else: 
            r=mid
    return l-1

