N,M=map(int,input().split())

def find_negative_loop(n,w,es):
  dist=[float("inf")]*n
  #
  dist[1]=0

  for i in range(n):
    for j in range(w):
      e=es[j]
      if dist[e[1]]>dist[e[0]]+e[2]:
        dist[e[1]]=dist[e[0]]+e[2]
        if i==n-1:
          return True
  return False

def shortest_path(s,n,w,es):
  #si
  #s:, n:, w:, es[i]:[,,]
  dist=[float("inf")]*n
  #d[i]: si
  dist[s]=0

  while True:
    update=False
    for p,q,r in es:
      # e: i [from,to,cost]
      if dist[p]!=float("inf") and dist[q]>dist[p]+r:
        dist[q]=dist[p]+r
        update=True
    if not update:
      break

  return dist

